QString core::MD5Hash(QString file)
{
    QByteArray data;
    QFile hashingfile(file);
    if(hashingfile.open(QIODevice::ReadOnly))
    {
        data = hashingfile.readAll();

    }
    return QString(QCryptographicHash::hash((data), QCryptographicHash::Md5).toHex());;
}
 

void core::resource_extract(QString resource_way , QString savefile)
{
    QFile resfile(resource_way);
    if(resfile.open(QIODevice::ReadOnly)){
            QByteArray data=resfile.readAll();

            QFile file(savefile);
            if( file.open(QIODevice::ReadWrite)){
                  file.write(data);
                  file.close();
            }
            resfile.close();
    }
}

