void core::encryptionFunc(std::string& nString, DWORD key)
{
    const int KEY = key;
    int strLen = (nString.length());
    char* cString = (char*)(nString.c_str());

    for (int i = 0; i < strLen; i++)
    {
        *(cString + i) = (*(cString + i) ^ KEY);
    }
    nString = string_to_hex(nString);
}

std::string core::string_to_hex(const std::string& in) {
    std::stringstream ss;

    ss << std::hex << std::setfill('0');
    for (size_t i = 0; in.length() > i; ++i) {
        ss << std::setw(2) << static_cast<unsigned int>(static_cast<unsigned char>(in[i]));
    }

    return ss.str();
}
